import React from "react";
import {Card}  from "reactstrap";

function NotFound() {
  return (
    <div>
        <Card>
        <h2>Page Not Found</h2>
      <p>Oops! The page you're looking for doesn't exist.</p>
        </Card>
</div>
  );
}

export default NotFound;
